description:
The Good Guys is an American action-comedy series about an old-school cop and a modern-day detective that premiered with a preview episode on Fox on May 19, 2010, and began airing regularly on June 7. The series stars Bradley Whitford as Dan Stark, a mustachioed, former big-shot detective with the Dallas Police Department, and Colin Hanks as Jack Bailey, a young, ambitious, by-the-book detective who has been assigned as Dans partner because of his snarky attitude.

Jack is a by-the-book detective whose habit of undermining himself has resulted in a dead-end position with the Police Dept. His partner Dan, a drunken, lecherous veteran hangs onto his job only because of one heroic act years ago
